import React from 'react';
import styles from './MenuStyle.css';
import HomeIcon from '@material-ui/icons/Home';

function SideMenuItem(props){
    let comp;
    return(
        <div className = {styles.menuItemStyle}>
            <HomeIcon></HomeIcon>    
            <h2>{props.header}</h2>
        </div>
    )
}

export default SideMenuItem;
